import React from 'react'

const App = () => {



  return (
    <>
          <h1>Sending / receiving from server</h1>
          <input type="text" name="username" id="username"/>
          <input type="text" name="note" id="note"/>
          <button onClick={createNewUser}>Create user</button>
    </>
  )
}

export default App
